import "./User.css";
function User({ id, name, age }) {
  return (
    <div className="container">
      <p>
        id : {id}
        <button>click</button>
      </p>
      <p>name : {name}</p>
      <p>age : {age}</p>
    </div>
  );
}

export default User;
